import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, TextInput, TouchableOpacity } from 'react-native';
import { Button } from 'react-native-elements'


import { createAppContainer } from 'react-navigation';
import { createStackNavigator } from 'react-navigation-stack';

export default function HomeScreen({ navigation }) {

  return (

    <View style={styles.regform}>

      <Text style={styles.header}>Welcome on Esport-Influence App</Text>


      <TouchableOpacity style={styles.button}>
        <Button onPress={() => navigation.navigate('SignIn')} style={styles.btntext} title="Sign in"/>
      </TouchableOpacity>
      <TouchableOpacity style={styles.button}>
        <Button onPress={() => navigation.navigate('RegisterBrand')} style={styles.btntext} title="Sign up as a Company" />
      </TouchableOpacity>
      <TouchableOpacity style={styles.button}>
        <Button onPress={() => navigation.navigate('RegisterInfluencer')} style={styles.btntext} title="Sign up as an Influencer" />
      </TouchableOpacity>

    </View>

  )
}

const styles = StyleSheet.create({
  regform: {
    alignSelf: 'stretch',
  },
  header: {
    fontSize: 24,
    color: '#fff',
    paddingBottom: 10,
    marginBottom: 40,
    borderBottomColor: '#199187',
    borderBottomWidth: 1
  },
  textinput: {
    alignSelf: 'stretch',
    height: 40,
    marginBottom: 30,
    color: '#fff',
    borderBottomColor: '#f8f8f8',
    borderBottomWidth: 1
  },
  button: {
    alignSelf: 'stretch',
    alignItems: 'center',
    padding: 20,
    backgroundColor: '#59cbbd',
    marginTop: 30,
  },
  btntext: {
    color: '#fff',
    fontWeight: 'bold'
  }
});
